(1, 'ป้ายไวนิลน้ำแข็ง', 'Fam', '0931758306', 1, NULL, 'Fam', 'จัดส่ง... รถตู้แม่สอด\r\n\r\nคุณศุทธวีร์ ที่อยุ่ 364 หมู่ที่6 ต.แม่ตาว อ.แม่สอด จ.ตาก 63110 \r\n0931758306', NULL, '<p>ป้ายไวนิล พิมพ์ 2 ด้าน ตอกไก่ 4 มุม<br>ขนาด 58x112 ซม. จำนวน 1 ชิ้นๆ ละ 350.-<br><br>ค่าส่ง 100.-<br><br>รวมยอดชำระ 450.-<br><br>---------------------------------------------------------<br><br>ข้อความว่า..<br><br>ร้านน้ำแข็ง<br>สะอาด<br>จำหน่าย<br>น้ำแข็งหลอด-บด<br>ปลีก/ส่ง รับส่งทุกงาน<br>ติดต่องาน0878472765<br> 0931758306</p>', NULL, '2021-05-06', '09:00:00', '4', NULL, '2021-05-05 02:05:20', 16, 'W_Dy_0CqF2px9NwnokjDCE', 1, 0, 0, 1, 0, 1, 0, NULL, NULL, 2, 0, 2, 0, 1, 8, '2021-05-12 10:03:13', '', 1, 1, NULL),
(2, '​ไวนิลในหลวงร.10 ', 'thanyaสวนป่าแม่ละเมา', '098-8262052', 1, NULL, 'thanyaสวนป่าแม่ละเมา', 'รับหน้าร้าน ', NULL, '<p>ไวนิลในหลวงร.10<br>ขนาด 100x150 cm. 1 ชิ้นๆละ 240 บาท</p>', NULL, '2021-05-05', '13:00:00', '4', NULL, '2021-05-05 02:32:04', 8, 'LpFjgcw2rQ7R8maXPwoNE6', 0, 0, 1, 1, 1, 1, 0, NULL, NULL, 2, 0, 0, 0, 1, 8, '2021-05-12 10:12:58', '', 1, 1, NULL),
