(92, 'ที่ทำการกลุ่มออมทรัพย์เพื่อการผลิตบ้านลานยาง', 'ไอติม พช เมืองตาก', '0895607026', 1, NULL, 'ไอติม พช เมืองตาก', 'ที่ทำการอำเภอเมืองตาก\r\nส่วนงาน : พัฒนาชุมชนอำเภอเมืองตาก ', NULL, '<p>1. ป้ายที่ทำการฯ<br>อะคริลิคน้ำเงินพิมพ์ยูวีตัวอักษรขาว ขนาด 60X30 ซม.<br><br>ที่ทำการกลุ่มออมทรัพย์เพื่อการผลิตบ้านลานยาง<br>หมู่ที่ 10 ตำบลวังประจบ อำเภอเมืองตาก จังหวัดตาก<br><br>สนับสนุนโดย สำนักงานพัฒนาชุมชนอำเภอเมืองตาก<br><br>ใส่โลโก้ พช กับโลโก้กลุ่มออมทรัพย์จ้า</p><p>-----------------------</p><p>2. ป้ายไวนิลโครงการ 300X100 ซม. จำนวน 1 ป้าย<br>พับขอบตอกตาไก่<br><br>โครงการพัฒนาศักยภาพกลุ่มออมทรัพย์เพื่อการผลิตสู่มาตรฐาน SMART Saving Group<br>วันที่ 25 พฤษภาคม 2564<br>ณ บ้านลานยาง หมู่ที่ 10 ตำบลวังประจบ อำเภอเมืองตาก จังหวัดตาก<span class=\"redactor-invisible-space\"></span></p><p>ใส่โลโก้ พช กับโลโก้กลุ่มออมทรัพย์จ้า<span class=\"redactor-invisible-space\"></span></p><p>-------------------------------------</p><p>3. ป้ายไวนิลโครงการสัมมาชีพชุมชน จำนวน 2 ป้าย</p><p>ป้ายไวนิลพับขอบตอกตาไก่ <br><br>1.บ้านสันติสุข หมู่ที่ 8 ตำบลน้ำรึม อำเภอเมืองตาก จังหวัดตาก<br>2.บ้านลานสาง หมู่ที่ี 11 ตำบลแม่ท้อ อำเภอเมืองตาก จังหวัดตาก</p><p>------------------------------------</p>', NULL, '2021-05-17', '15:00:00', '3, 4', NULL, '2021-05-17 03:42:20', 8, 'CPzscmmVggSVGf8cyBCB0N', 0, 0, 1, 1, 1, 1, 0, NULL, NULL, 2, 0, 0, 0, 1, NULL, '2021-05-19 01:43:19', '', 2, 1, NULL),
