(107, 'ไวนิล', 'PEKKIIZ\' พช.เมืองตาก', '', 1, NULL, 'PEKKIIZ\' พช.เมืองตาก', 'รับงานหน้าร้าน 25/05/64', NULL, '<p>ไวนิลขนาด 300x100 ซม. 1 ชิ้นๆละ 450.-<br><br>ชื่อโครงการ<br>โครงการส่งเสริมและพัฒนาหมู่บ้านกองทุนแม่ของแผ่นดิน<br>กิจกรรมย่อยที่ 1 ประชุมเชิงปฏิบัติการคณะกรรมการหมู่บ้านต้นกล้ากองทุนแม่ของแผ่นดิน<br><br>ศาลาเอนกประสงค์บ้านหนองเสือ หมู่ 8 ตำบลวังประจบ อำเภอเมืองตาก จังหวัดตาก<br><br>- โลโก้ พช.<br>- โลโก้กองทุนแม่ของแผ่นดิน</p>', NULL, '2021-05-25', '10:00:00', '3, 4', NULL, '2021-05-19 07:11:22', 8, 'o-ySwjoOAuPPCkM5vP0HwB', 0, 0, 0, 1, 1, 1, 0, NULL, NULL, 1, 0, 1, 0, 1, 1, '2021-05-20 08:19:05', '', 3, 1, NULL),
