(209, 'รูปราชินี + ติดตั้งงาน ', 'ศาลากลาง', '', 4, '', 'ลูกค้าพี่ณัฐ ', '-', NULL, '<p>ตั้งรูปราชินีหน้าศาลากลาง<br></p><p> - ปิดแผ่นหน้า</p><p>- ปูพรมแดง</p><p>- ตั้งรูป</p><p><br></p><p>* กราฟฟิกและช่าง </p>', NULL, '2021-05-29', '13:00:00', '3', NULL, '2021-05-28 08:31:23', 8, 'uhc5WYqSQ9XNMsjdGGAAbP', 1, 1, 0, 0, 1, 1, 0, NULL, NULL, 1, 0, 0, 2, 1, NULL, NULL, NULL, 3, 1, 3),
