(211, 'หนังสือคู่มือสำหรับผู้มีบ่อนำ้บาดาล และป้ายไวนิล', 'คุณนก ทสจ.ตาก', '086-9380151', 1, 'คุณนก ทสจ.ตาก', '', 'สำนักงานทรัพยากรธรรมชาติและสิ่งแวดล้อมจังหวัดตาก\r\nศาลากลางตึกเก่า ชั้น 2 ห้องทรัพยากร', NULL, '<p>หนังสือคู่มือสำหรับผู้มีบ่อน้ำบาดาล</p><p>ขนาดสำเร็จ A4 กางออก A3 จำนวน 32 หน้ารวมปก</p><p>หน้าปก พิมพ์ 4 สี 2 ด้าน กระดาษอาร์ตมัน 160 แกรม</p><p>เนื้อใน พิมพ์ 4 สี 2หน้า กระดาษปอนด์ 80 แกรม</p><p>เย็บมุงหลังคา จำนวน 800 เล่ม</p><p>**ลูกค้ามีไฟล์มาให้ และให้แก้ไขนิดหน่อย **</p><p>--------------------------------------------</p><p>ป้ายประชาสัมพันธ์เกี่ยวกับการกระทำผิดกฎหมายน้ำบาดาล</p><p>ป้ายไวนิลพับขอบตอกตาไก่ </p><p>ขนาด 150X100 ซม. จำนวน 50 ผืน</p><p>.</p><p>อ้างอิงใบเสนอราคา QT2021050099</p><p>กำหนดส่งมอบงานตาม TOR 20/6/2564</p>', NULL, '2021-06-20', '10:00:00', '3', NULL, '2021-05-28 09:41:53', 8, 'tDe_gW7EbUsAd2iR1JSkc7', 0, 0, 0, 0, 1, 1, 0, NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, 1, 1, 3),
