(228, 'ฟิวพิมพ์ยูวี (เมนู)', 'Malee', '0856017651', 1, 'Malee', '', '-', NULL, '<p>งานเพิ่ม<br>เมนูฟิวพิมพ์ยูวี ขนาด 110x70 ซม. 1 ชิ้น (แบบเดิม)<br>- ตัวใหญ่ขึ้น<br>- เปลี่ยนราคาตรงเมนูกาแฟ<br>เอสเพรสโน่ ถึง มอคค่า. เปลี่ยนราคาตรงปั่น เป็น 50 บาท<br>แบล็คคอมฟี่น้ำผึ้งมะนาว. ไม่มีปั่น<br>เนสกาแฟ. ปั่น 40<br>ขยายตัวอักษร เมนูให้ใหญ่ขึ้น</p>', NULL, '2021-06-01', '09:30:00', '3', NULL, '2021-05-31 02:23:37', 8, '0SSbtzMJPRvXC4fKwiJ33a', 0, 0, 0, 0, 1, 1, 0, NULL, NULL, 2, 0, 0, 0, 0, NULL, NULL, NULL, 3, 1, 4),
(229, 'สติ๊กเกอร์ไดคัท ', 'M', '0900263085', 1, 'M', '', '', NULL, '<p>- สติ๊กเกอร์กระดาษไดคัท จำนวน 1 ตรม. 400 บาท</p><p>(แบบงานอยู่ในเมล์)</p>', NULL, '2021-06-03', '16:00:00', '3', NULL, '2021-05-31 03:13:35', 8, '798vkHXH6DbRhrCFolqKu_', 0, 0, 0, 2, 1, 1, 0, 99, 'สถานะล่าสุดไม่ถูกต้อง เนื่องจากบัญชี approve งานหายจากระบบ', 0, 0, 0, 0, 0, NULL, NULL, NULL, 4, 1, 4),
(230, 'ฉากกั้นอะคริลิค', 'ที่ดินตาก ', '', 4, '', 'ลูกค้าพี่ณัฐ ', '', NULL, '<p>เพิ่มเติมสอบถามพี่ณัฐค่ะ </p>', NULL, '2021-05-31', '13:00:00', '4', NULL, '2021-05-31 03:54:40', 8, 'jTUNL0uaZj-YxLT7ksecns', 0, 0, 0, 0, 1, 1, 0, NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, 4, 1, 4),
(231, 'สติ๊กเกอร์ไดคัท ', 'OEL', '0810388359', 1, 'OEL', '', '', NULL, '<p>สติ๊กเกอร์ PVC<br>พิมพ์สติ๊กเกอร์ขนาด 49x62cm 4 ชิ้นๆละ 100.- = 400.- </p>', NULL, '2021-05-31', '14:00:00', '3', NULL, '2021-05-31 04:06:32', 8, '1dq4xbcGIE1aQ7DkbVsOQ9', 0, 0, 0, 0, 1, 1, 0, NULL, NULL, 2, 0, 2, 0, 0, NULL, NULL, NULL, 4, 1, 2),
(232, 'ไวนิลพับขอบตอกไก่ 4 ด้าน ', 'เมธา SKF เอสเค', '0955915142', 1, 'เมธา SKF เอสเค', '', '-', NULL, '<p>ไวนิลขนาด 400x100 ซม. 1 ผืนๆละ 640.-<br>พับขอบเจาะตอกไก่<br>รับบ่ายวันนี้ 31/01</p>', NULL, '2021-05-31', '12:30:00', '3', NULL, '2021-05-31 04:20:06', 8, '2ouxAFVeOhe1k8EQpel9yw', 0, 0, 0, 0, 1, 1, 0, NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, 4, 1, 4);
