(233, 'ออกแบบ', 'เอดโพธิ์ดำ', '090-2859691', 1, 'เอดโพธิ์ดำ', '', '-', NULL, '<p>ออกแบบงานขนาด 60x160 ซม. </p><p>ตาก บ้านมือสอง</p><p> Home2hand<br><br><img alt=\"????\" src=\"https://static.line-scdn.net/emoji/edge/v300/1f4e3.png\"><img alt=\"????\" src=\"https://static.line-scdn.net/emoji/edge/v300/1f4e3.png\">แหล่งรวม \"บ้านมือสอง\" ที่มากที่สุดในจังหวัดตาก<img alt=\"????\" src=\"https://static.line-scdn.net/emoji/edge/v300/1f4e3.png\"><img alt=\"????\" src=\"https://static.line-scdn.net/emoji/edge/v300/1f4e3.png\"><br><br>อยากขาย.. บ้าน !<br>อยากซื้อ.. บ้าน ‼<br>เรายินดีให้คำปรึกษา<br> #พร้อมทีมงานมืออาชีพ<br><br>- ดูแลจบครบทุกขั้นตอนจนถึงวันโอน<br>- ทำการตลาดให้ฟรี ไม่มีค่าใช้จ่าย จนกว่าจะขายได้<br><br><img alt=\"????\" src=\"https://static.line-scdn.net/emoji/edge/v300/1f60a.png\">เราขอเป็นส่วนหนึ่งในการสร้างรอยยิ้มให้กับพี่ๆ น้องๆ ทุกท่านในจ.ตาก<br><br>ติดต่อสอบถาม<br>☎ : 090-2859691 คุณเอด<br><img alt=\"☎️\" src=\"https://static.line-scdn.net/emoji/edge/v300/260e.png\"> : 095-6431741 คุณแคท<br><br><img alt=\"????\" src=\"https://static.line-scdn.net/emoji/edge/v300/1f44d.png\">ฝากติดตามเพจ ตากบ้านมือสอง TakHome2Hand ด้วยนะครับ<br><br>#คุยเรื่องบ้านคืองานของเรา #ตากบ้านมือสอง #TakHome2Hand</p><p><br></p>', NULL, '2021-06-02', '13:00:00', '3', NULL, '2021-05-31 06:18:19', 8, 'aFG8K_2GW86nb1vH9wu07c', 1, 0, 0, 0, 1, 1, 0, NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, NULL, 2, 1, 4),
